export default function Comments(){
    const [comments]=useComments(1);
    console.log(comments)

    return(
        <div className="container">
        <div className="row">
            {comments.map((comment)=><Post
                key={comment.id}
                title={comment.title}
                description={comment.body}
            ></Post>)}
        </div>
    </div>
    )
}
